"use strict";

function f_gold(n) {
    const dp = Array.from({length: n + 10}, () => Array(n + 10).fill(0));
    for (let l = 2; l <= n; l++) {
        for (let i = 1; i <= n - l + 1; i++) {
            const j = i + l - 1;
            dp[i][j] = Infinity;
            for (let k = i; k <= j; k++) {
                const t = Math.max(dp[i][k - 1], dp[k + 1][j]) + k;
                dp[i][j] = Math.min(dp[i][j], t);
            }
        }
    }
    return dp[1][n];
}
